import React from 'react';
import LogItem from '../logs/LogItem';

const Logs = () => {
  return (
    <ul className='collection with-header'>
      <li className='collection-header center'>
        <h4>Logs</h4>
      </li>
      <LogItem />

      {/* <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li>
      <li class='collection-item'>Alvin</li> */}
    </ul>
  );
};

export default Logs;
